"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[673],{7994:e=>{e.exports=JSON.parse('[{"id":"/2025/07/11/pasta","metadata":{"permalink":"/blog/2025/07/11/pasta","source":"@site/blog/2025-07-11-pasta.md","title":"Pasta-Party 2025","description":"Staffel","date":"2025-07-11T00:00:00.000Z","formattedDate":"11. Juli 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Pasta-Party 2025","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","permalink":"/blog/2025/05/28/_streckenchecks copy"}},"content":"![Staffel](/img/banner/Laufen.png)\\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d **Pasta-Party unterst\xfctzt von FALK** \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 Am 26.07. um 18:00 Uhr findet die Pasta-Party f\xfcr alle Teilnehmer des Heidelbergman Triathlons statt. \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nDen Anmeldelink f\xfcr die Pasta-Party findet ihr hier: [Anmeldung Pasta-Party](https://docs.google.com/forms/d/1tHHbxZKvosAGmkW--T4wtbQQ8HrAj9cUo49eBbezzI0/viewform)\\n\\nVielen Dank an FALK f\xfcr die Unterst\xfctzung bei der Pasta-Party! \ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\n\ud83d\udcc5 \\\\\\nDatum: 26.07.2024 \\\\\\nZeit: 18:00 Uhr \\\\\\nOrt: Neckarwiese, Heidelberg \\\\\\n\\nFreut Euch auf: \\\\\\nLeckere Pasta-Variationen \\\\\\nErfrischende Getr\xe4nke \\\\\\nEine entspannte Atmosph\xe4re zum Austausch mit anderen Teilnehmern \\\\\\nMotivation und Tipps von erfahrenen Athlet:innen \\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d \\\\\\nKosten: \\\\\\nF\xfcr Helfer:innen: Kostenlos \\\\\\nF\xfcr Triathlet:innen: 5\u20ac pro Portion\\\\ \\n\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\nDie Pastaparty ist die perfekte Gelegenheit, um sich gemeinsam auf den kommenden Wettkampf einzustimmen und sich mit Gleichgesinnten auszutauschen.\\n\ud83c\udf5d\ud83c\udf5d\ud83c\udf5d\\n\\nPS: Ihr k\xf6nnt gerne Freunde und Familie mitbringen!\\n\\n\ud83c\udf89\ud83c\udf89\ud83c\udf89 Wir freuen uns auf euch! \ud83c\udf89\ud83c\udf89\ud83c\udf89\\n\\n![FALK](/img/sponsor/main/falk2019.jpg)"},{"id":"/2025/05/28/_streckenchecks copy","metadata":{"permalink":"/blog/2025/05/28/_streckenchecks copy","source":"@site/blog/2025-05-28_streckenchecks copy.md","title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","description":"Staffel","date":"2025-05-28T00:00:00.000Z","formattedDate":"28. Mai 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Pasta-Party 2025","permalink":"/blog/2025/07/11/pasta"},"nextItem":{"title":"Streckenchecks","permalink":"/blog/2025/05/28/_streckenchecks"}},"content":"![Staffel](/blog/2025_last_start_platz.png)\\n\\nWir haben viele Nachfragen erhalten, ob es noch Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025 gibt. Die gute Nachricht ist: Ja, wir haben uns entschieden, die Anmeldung bis zum 30. Juni zu verl\xe4ngern und nochmal 10 Platze freizugeben! \\n\\nSichert euch jetzt die letzten Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025! Die Anmeldung \xf6ffnet nochmal am Freitag, den 27. Juni um 18:00 Uhr aber die Pl\xe4tze sind begrenzt. Verpasst nicht die Chance, Teil dieses aufregenden Events zu sein!"},{"id":"/2025/05/28/_streckenchecks","metadata":{"permalink":"/blog/2025/05/28/_streckenchecks","source":"@site/blog/2025-05-28_streckenchecks.md","title":"Streckenchecks","description":"Staffel","date":"2025-05-28T00:00:00.000Z","formattedDate":"28. Mai 2025","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Streckenchecks","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Letzte Startpl\xe4tze f\xfcr den Heidelberg Triathlon 2025","permalink":"/blog/2025/05/28/_streckenchecks copy"},"nextItem":{"title":"heidelBERGlegenden","permalink":"/blog/2025/05/07/_hd_legends"}},"content":"![Staffel](/blog/2025_streckenchecks.png)\\n\\nDie Streckenchecks sind eine tolle Gelegenheit, die Strecken des Heidelberg Triathlons kennenzulernen und sich optimal auf den Wettkampf vorzubereiten. Wir laden alle Teilnehmenden herzlich ein, an den Streckenchecks teilzunehmen.\\n\\n**Schwimmen im Neckar:**\\n- **06. Juli**: Testschwimmen im Neckar @Neckarwiese, Theodor-Heuss-Br\xfccke, 16:00 Uhr (Uferstra\xdfe 6, 69120 Heidelberg)\\n\\n**Radstreckenchecks:**\\n- ~~04. Mai: Radstreckencheck X VELOciraptors~~\\n- ~~18. Mai: Radstreckencheck X WattsUpGirls~~\\n- **28. Juni**: Radstreckencheck X ACE @Neckarwiese, Theodor-Heuss-Br\xfccke, 9:45 Uhr (Uferstra\xdfe 6, 69120 Heidelberg)\\n- **09. Juli**: Radstreckencheck X ACE  @Neckarwiese, Theodor-Heuss-Br\xfccke, 18:45 Uhr (Uferstra\xdfe 6, 69120 Heidelberg)\\n\\n**Laufstreckenchecks:**\\n- **15. Juni**: Laufstreckencheck X ACE @Neckarorte am R\xf6merbad, 9:45 Uhr\\n- **02. Juli**: Laufstreckencheck X ACE @Neckarorte am R\xf6merbad, 18:45 Uhr\\n\\nDie Streckenchecks sind kostenlos und bieten eine gro\xdfartige Gelegenheit, sich mit der Strecke vertraut zu machen, Tipps von erfahrenen Athlet\'innen zu erhalten und die Atmosph\xe4re des Heidelberg Triathlons zu erleben.\\nDie Teilnahme an den Streckenchecks ist f\xfcr alle Teilnehmenden des Heidelberg Triathlons offen, unabh\xe4ngig von der Distanz, die sie w\xe4hlen. Wir freuen uns auf zahlreiche Teilnehmer\'innen und eine tolle gemeinsame Vorbereitung auf den Wettkampf!\\n\\nWir freuen uns auf eure Teilnahme und w\xfcnschen euch viel Spa\xdf bei den Streckenchecks!"}]')}}]);